import React from "react";
import { Button, Col, Container, Form, Row } from "react-bootstrap";
import Completeregisterimg from "../imgs/unsplash_B7BnSfy0Lws.png";
import failed from "../imgs/alert.png";
import success from "../imgs/check-circle.png";

const Completeregister = ({ cc }) => {
  return (
    <div>
      <div style={{ backgroundColor: "#AEB4D4", height: "735px" }}>
        <Container>
          <Row className="d-flex justify-content-between align-items-center py-4">
            <Col sm="6">
              <img
                style={{ height: "85vh", borderRadius: "22px" }}
                src={Completeregisterimg}
              />
            </Col>
            <Col sm="6">
              <h3 style={{ color: "#646B85", fontFamily: "Ribeye" }}>
                Register
              </h3>
              <p style={{ color: "#646B85" }}>
                Please enter your details to register :
              </p>
              <div>
                <Form>
                  <Form.Group className="mb-4 " controlId="formBasicEmail">
                    <Form.Label style={{ fontWeight: "bold" }}>Name</Form.Label>
                    <Form.Control
                      style={{
                        height: "50px",
                        borderRadius: "40px",
                        backgroundColor: "#AEB4D4",
                        borderBottom: "1px solid white",
                      }}
                      type="text"
                    />
                  </Form.Group>
                  <Form.Group className="mb-4 " controlId="formBasicEmail">
                    <Form.Label style={{ fontWeight: "bold" }}>
                      Email address
                    </Form.Label>
                    <Form.Control
                      style={{ height: "51px", borderRadius: "8px" }}
                      type="email"
                      placeholder="Enter email"
                    />
                    <img
                      style={{
                        position: "absolute",
                        right: "9%",
                        top: "35.5%",
                      }}
                      src={success}
                    />
                  </Form.Group>
                  <Form.Group className="mb-4" controlId="formBasicPassword">
                    <Form.Label style={{ fontWeight: "bold" }}>
                      Username
                    </Form.Label>
                    <Form.Control
                      style={{ height: "51px", borderRadius: "8px" }}
                      type="text"
                      placeholder="Username"
                    />
                    <img
                      style={{
                        position: "absolute",
                        right: "9%",
                        top: "50.5%",
                      }}
                      src={failed}
                    />
                  </Form.Group>
                  <Form.Group className="mb-4" controlId="formBasicPassword">
                    <Form.Label style={{ fontWeight: "bold" }}>
                      Password
                    </Form.Label>
                    <Form.Control
                      style={{
                        height: "51px",
                        borderRadius: "8px",
                      }}
                      type="password"
                      placeholder="Password"
                    />
                    <img
                      style={{
                        position: "absolute",
                        right: "9%",
                        top: "65.5%",
                      }}
                      src={success}
                    />
                  </Form.Group>
                  <Form.Group className="mb-4" controlId="formBasicPassword">
                    <Form.Label style={{ fontWeight: "bold" }}>
                      Confirm Password
                    </Form.Label>
                    <Form.Control
                      style={{
                        height: "51px",
                        borderRadius: "8px",
                      }}
                      type="password"
                      placeholder="Password"
                    />
                    <img
                      style={{
                        position: "absolute",
                        right: "9%",
                        top: "81%",
                      }}
                      src={failed}
                    />
                  </Form.Group>

                  <div className="text-center ">
                    <Button
                      style={{
                        backgroundColor: "#1E3C5F",
                        width: "295px",
                        height: "48px",
                        borderRadius: "35px",
                      }}
                    >
                      Register
                    </Button>
                  </div>
                </Form>
              </div>{" "}
            </Col>
          </Row>
        </Container>
      </div>
    </div>
  );
};

export default Completeregister;
